ウェディングに使える豪華なフラワーモチーフ。大きいです。<br>ウェディングはもちろん、成人式やパーティ、帯などに付けていただいても素敵。<br>その他のウェディング素材はこちらからどうぞ <br>サイズ：画像をご参照ください。<br>生産国：中国<br>色：オフホワイト<br>素材：生地：ポリエステル<br>ご注意：<br>・中国製のため、多少作りが粗い部分がございます。花弁部分の生地のほつれ、花弁の形のゆがみ等がございます。<br>・花弁に黒い点や色の付いた繊維が混ざっているものがございます。<br>白いお色の花のため、気になるものもございますが、こちらは製造上の仕様となり避けられないものでございますので、ご了承の上、ご購入をお願い致します。<br><br><!-- ↓ポイントキャンペーン　始まり -->

